import React from 'react';
import './CartItem.css';

const CartItem = ({ productName, price}) => {

    return (
        <div className="cart-item">
            <div className="product-info">
                <a className="product-name">{productName}</a>
                <p className="product-price">{price}</p>
            </div>
        </div>
    );
};

export default CartItem;
